import axios from "axios";

export const logEvent = async (
  attemptId,
  type,
  questionId = null,
  metadata = {},
) => {
   console.log("TYPE:", type, typeof type);
  console.log("METADATA:", metadata);
  
  try {
    const response = await axios.post(
      `http://localhost:5000/api/attempt/${attemptId}/event`,
      {
        events: [
          {
            // eventType: type,
            // timestamp: new Date().toISOString(),
            // questionId,
            // metadata,

            eventType: event.eventType,
            timestamp: new Date().toISOString(),
            questionId: event.questionId || null,
            metadata: event.metadata || {},
          },
        ],
      },
    );

    return response.data;
  } catch (error) {
    console.error(
      "Error logging event:",
      error.response?.data || error.message,
    );
  }
};

export const submitTest = async (attemptId) => {
  try {
    const response = await axios.post(
      `http://localhost:5000/api/attempt/submit/${attemptId}`,
    );

    return response.data;
  } catch (error) {
    console.error("Submit failed:", error.response?.data || error.message);
    throw error;
  }
};

export const getAttemptById = async (attemptId) => {
  const response = await axios.get(
    `http://localhost:5000/api/attempt/${attemptId}`,
  );

  return response.data;
};
